  for voter registration and voting innsuburban Cook County between Oct. 8 and election
  day, Nov. 4, 2014. Voters maynvisit one of the 18 election day registration sites
  if they are not already registered nand eligible to vote in their precinct. For
  more information on Early Voting see http://www.cookcountyclerk.com/elections/earlyvoting/Pages/default.aspx
